import React, { useEffect, useState } from "react";
import sendFormSql from "../services/sendFormSql";
import { useNavigate } from "react-router-dom";

const SeeTrips = () => {
  const [trips, setTrips] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTrips = async () => {
      const data = await sendFormSql.getTrips();
      setTrips(data);
    };
    fetchTrips();
  }, []);

  const handleDelete = async (id) => {
    await sendFormSql.deleteTrip(id);
    setTrips((prevTrips) => prevTrips.filter((trip) => trip.id !== id));
  };

  const handleEdit = (trip) => {
    navigate("/edit-trip", { state: { trip } }); // Navegar con los datos del viaje
  };

  return (
    <div className="see-trips">
      <h2>Registered Trips</h2>
      <table>
        <thead>
          <tr>
            <th>Country</th>
            <th>Year</th>
            <th>Month</th>
            <th>Duration</th>
            <th>Cost</th>
            <th>KM Travelled</th>
            <th>Hotel</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {trips.map((trip) => (
            <tr key={trip.id}>
              <td>{trip.country}</td>
              <td>{trip.year}</td>
              <td>{trip.month}</td>
              <td>{trip.duration}</td>
              <td>{trip.cost}</td>
              <td>{trip.km_travelled}</td>
              <td>{trip.hotel}</td>
              <td>
                <button onClick={() => handleEdit(trip)}>Edit</button>
                <button onClick={() => handleDelete(trip.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="lower-section">{/* Parte vac√≠a por ahora */}</div>
    </div>
  );
};

export default SeeTrips;
